import React from 'react';
import './Slide.css';
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";


class Slide extends React.Component {
  render() {
    const settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1,
      autoplay: true,
      fade: true, 
      arrows: true,
      // centerMode: true,
    };
    return (
         <Slider {...settings} className="slide">
           <div className="header-img header-img0"> </div>
           <div className="header-img header-img1"> </div>
           <div className="header-img header-img2"> </div>
           <div className="header-img header-img3"> </div>
           <div className="header-img header-img4"> </div>
           <div className="header-img header-img5"> </div>
           <div className="header-img header-img6"> </div>
           <div className="header-img header-img7"> </div>
           <div className="header-img header-img8"> </div>
         </Slider>
      );
  }
}

export default Slide;
